const getGoogleSheetData = async (url) => {
  const data = fetch(url).then((res) => res.text());

  let response = {};

  data.then((result) => {
    const resp = result
      .replace("google.visualization.Query.setResponse(", "")
      .replace("/*O_o*/", "")
      .replace("\n", "")
      .replace(");", "");

    response = JSON.parse(resp);
  });

  console.log(response);

  return response;
};

export default getGoogleSheetData;
